function ExpenseItem() {
  return (
    <div className="expense-item">
      <div>December 1st 2020</div>
      <div classNmae="expense-item__discription">
        <h2>Car Insurance</h2>
      </div>

      <div>5000 rs</div>
    </div>
  );
}
export default ExpenseItem;
